import { useState } from "react";
import { Form } from "react-bootstrap";

function OTP1(){
    const[email,Setemail]=useState("")
    const hanDle=(b)=>{
        Setemail(b.taget.value) 
    }
    const handelSubmit=()=>{
            let data={email}
            fetch("http://localhost:3008/otp",{
            method:"POST",
            headers:{"Content-type":"application/json"},
            body:JSON.stringify(data)
        
            })
            .then(()=>{
                alert("saved sucessfully")
            })
            .catch((n)=>{
              console.log(n);
                
            })
    return(
        <div style={{backgroundColor:"skyblue",padding:"20px"}}>
            <br/><br/><br/>
            <h4>Get started</h4>
            <br/><br/>
            <Form onSubmit={handelSubmit}>
                <input style={{padding:"5px"}} type="text" placeholder="Mobile/Email" value={email} onChange={ hanDle}/><br/><br/>
                <button style={{width:"195px",padding:"5px",backgroundColor:"lightblue"}}>Continue</button>
<br/><br/>
